//Function to getStates from internet or locally
export async function getStates(isConnected) {
  try {
    console.log("Getting entities, isConnected", isConnected);
    //If it's connected, then we get the data from internet
    if (isConnected) {
      const url = `${API_HOST}federative_entity`;
      console.log("url de entidades", url);
      const response = await fetch(url);
      console.log("Response in entities", response);
      const result = response.json();
      console.log("Result in entities", result);
      // return result;
      // const config = {
      //   headers: {
      //     "Content-Type": "application/json",
      //   },
      // };
      // const response = await axios.get(url, config);
      // console.log("Response in entities", response);
      // const result = response.json();

      return result;
    } else {
      //Getting data from clues var
      //Here we compress the info by state
      const result = clues
        .map((item) => {
          return {
            entity_key: item["CLAVE DE LA ENTIDAD"],
            entity_name: item["NOMBRE DE LA ENTIDAD"],
          };
        })
        .filter((item, index, self) => {
          return (
            index === self.findIndex((t) => t.entity_key === item.entity_key)
          );
        });
      return result;
    }
  } catch (error) {
    throw error;
  }
}

//Then municipalities, filtered by state
export async function getMunicipalities(state, isConnected) {
  try {
    //Check if is it connected or not
    if (isConnected) {
      const url = `${API_HOST}municipality/${state}`;
      console.log("url municipalities", url);
      const response = await fetch(url);
      const result = response.json();
      return result;
    } else {
      //Getting data from clues var, grouped by municipality
      //convert state from 1 to "01"
      state = state.toString().padStart(2, "0");
      const result = clues.filter((item) => {
        return item["CLAVE DE LA ENTIDAD"] === state;
      });
      //Then we response "Clave del municipio" and "Nombre del municipio" from clues array
      const result2 = result
        .map((item) => {
          return {
            key_municipality: item["CLAVE DEL MUNICIPIO"],
            name_municipality: item["NOMBRE DEL MUNICIPIO"],
          };
        })
        .filter((item, index, self) => {
          return (
            index ===
            self.findIndex((t) => t.key_municipality === item.key_municipality)
          );
        }) //order by key_municipality
        .sort((a, b) => {
          return a.key_municipality - b.key_municipality;
        });
      return result2;
    }
  } catch (error) {
    throw error;
  }
}

//Finally filtering by clinics
export async function getClinics(state, municipality, isConnected) {
  try {
    //First check wether is connected to internet
    if (isConnected) {
      const url = `${API_HOST}clue/${state}/${municipality}`;
      const response = await fetch(url);
      const result = response.json();
      return result;
    } else {
      //If not, then we get the data from clues var
      //grouped by clue, filtered by state and municipality
      //convert state from 1 to "01"
      //and municipality from 1 to "001"
      state = state.toString().padStart(2, "0");
      municipality = municipality.toString().padStart(3, "0");
      console.log("State", state);
      console.log("Municipio", municipality);
      const result = clues.filter((item) => {
        return (
          item["CLAVE DE LA ENTIDAD"] === state &&
          item["CLAVE DEL MUNICIPIO"] === municipality
        );
      });
      //Then we response "id" and "NOMBRE DE LA UNIDAD" from clues array
      const result2 = result
        .map((item) => {
          return {
            id: item["ID"],
            name_unit: item["NOMBRE DE LA UNIDAD"],
          };
        })
        .filter((item, index, self) => {
          return index === self.findIndex((t) => t.id === item.id);
        });
      console.log("Clínicas", result2);
      return result2;
    }
  } catch (error) {
    throw error;
  }
}

